import React from "react";

/**
 * 화살표 함수형 컴포넌트
 */
function MySubComponent() {
    return (
        <div>
            <ul>
                <li>item1</li>
                <li>item2</li>
                <li>item3</li>
            </ul>
        </div>
    );
};

export default MySubComponent;
